import React from "react";
import "../css/bar.css";

function Sidebar() {
  return (
    <div className="sidebar">
      <h3>Sidebar</h3>
      <p>Content goes here</p>
    </div>
  );
}

function Navbar() {
  return (
    <div className="navbar">
      <h3>Navbar</h3>
      <p>Navigation links go here</p>
    </div>
  );
}

const Nav = () => {
  return (
    <div>
      <Navbar />
      <Sidebar />
    </div>
  );
};

export default Nav;
